	add("future", "{\"term\":\"future\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{PIE root|en|bʰuH}}From Old french (842-ca. 1400) {{m|fro|futur}}, from Latin {{m|la|futūrus}}, irregular future active participle of {{m|la|sum||I am}}, from Proto-indo-european {{m|ine-pro|*bʰuH-||to become, be}}. Cognate with Old english (ca. 450-1100) {{m|ang|bēo||I become, I will be, I am}}. More at {{l|en|be}}. Displaced native Old english (ca. 450-1100) \u0027toweard\u0027 in the given sense.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The time ahead; those moments yet to be experienced\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something that will happen in moments yet to come\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Goodness in what is yet to come. Something to look forward to\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21582512-explosion-start-ups-changing-finance-better-revenge-nerds Revenge of the passage\u003dThink of banking today and the image is of grey-suited men in towering skyscrapers. Its \u0027\u0027future\u0027\u0027, however, is being shaped in converted warehouses and funky offices in San Francisco, New York and London, where bright young things in jeans and T-shirts huddle around laptops, sipping lattes or munching on free food\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Verb tense used to talk about events that will happen in the future; future tense\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A standardized, tradable agreement between two parties that one will sell and the other will buy a specific commodity at a specific later date and a specific price\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An object that retrieves the value of a promise\", \"priority\":7}]}, \"synonyms\":{}}");

